import React, { Component } from "react";
import Projects from "./Projects";
import SocialProfiles from "./SocialProfiles";
import "./app.css";
import profilePic from "./assets/profile.png";
import Title from "./title";

class App extends Component {

    state = { displayBio: false }

    toggleDisplayBio = () => {
        this.setState({ displayBio: !this.state.displayBio });
    }


    render() {



        return (
            <div>
                <img src={profilePic} alt="profile-picture" style={{ width: 200, height: 200, borderRadius: 100 }} />
                <h1>Hello!</h1>
                <p>I am student pursuing B.Tech in Computer Science in the second year of college.</p>
                <p>Check my bio for more details.</p>
                <p><Title /></p>

                {(this.state.displayBio) ?
                    (<div>
                        <p>Hi! I'm Aditya Kumar Singh. I'm pursuing B.Tech in Compiuter Science from School of Engineering in Kochi,India.</p>
                        <p>I can build intermediate websites using Expressjs,Nodejs,MongoDB,Reactjs,EJS templating.</p>
                        <p>Checkout the projects I've linked.</p>
                        <button onClick={this.toggleDisplayBio}>Read Less</button>
                    </div>) :
                    <div>
                        <button onClick={this.toggleDisplayBio}>Read More</button>
                    </div>}
                <hr />

                <Projects />
                <SocialProfiles />
            </div >
        )
    }
}

export default App;
